Reduce your expectations to 0 😅 specially on the pendulum squat machine. This is easy a torture device for those who love pain. Recently started to introduce this machine in my program and it’s a total killer. It’s a great tool for building your quads because of it’s large range of motion. 
🦾You want to make sure you’re doing full knee extension and maximize the work your muscles do in each rep. So add the amount of weight you can control all the way down for 6-8 reps. The machine itself it’s already pretty heavy so heads up! 🦾☃️ 
